 //import { addListener } from "nodemon";
import React, { useState ,useEffect} from "react";

const Search =()=>{
  const [books,setBooks]=useState([]);
  const booktable=async()=>{
    let result=await fetch('http://localhost:5000/getbooks');
    result= await result.json();
    setBooks(result);
  }
  console.log(books);

  useEffect(()=>{
    booktable();
  },[]);


  const [dataSource,setDataSource]=useState(books);
  const[tablefilter,setTableFilter]=useState([]);
  const filterData =(e)=>{
   if(e.target.value !== ""){
    setBooks(e.target.value);
    const filterTable = dataSource.filter(item=>Object.keys(item).some(k=>
      String(item[k]).toLowerCase().includes(e.target.value.toLowerCase())
      ));

   setTableFilter([...filterTable])
     } else{
setBooks(e.target.value);
setDataSource([...dataSource])
  }
}


 return(
    <div>
        <div className="topnav">
      <h2 id="head">User Portal</h2>
      </div>
        <div className="sidebar">
        <a href="Home.js"><i className="fa fa-fw fa-home" id="navtag"></i> Home</a>
        <a href="#services"><i className="fa fa-fw fa-wrench" id="navtag"></i> Book Search</a>
        <a href="#contact"><i className="fa fa-fw fa-envelope" id="navtag"></i> View Date Info</a>
        <a href="#clients"><i className="fa fa-fw fa-user" id="navtag"></i> Return Book</a>
        <a href="#contact"><i className="fa fa-fw fa-envelope" id="navtag"></i> Place Order</a>
        <a href="#contact"><i className="fa fa-fw fa-envelope" id="navtag"></i> Log Out</a>
      </div>
      <div className="form-group" id="search">
      <form className="d-flex">
            {/* <h4>Search Books</h4><br/> */}
              <input className="form-control me-3 p-2" type="text" onchange={filterData} placeholder="Search Books" />
              <button className="col btn btn-dark mx-1 " id="sbtn" type="button">Search</button>
            </form>
          </div>
          <div id="table">
      <table className="table table-bordered"  >
    <thead>
      <tr>
        <th>Book Id</th>
        <th>Title</th>
        <th>Author Name</th>
        <th>Cost</th>
        <th>Book Qantity</th>
      </tr>
    </thead>
    <tbody>
      {books.lenght > 0 ? tablefilter.map((item)=>{
          return(
           <tr key={item.id}>
            <td>{item.id}</td>
            <td>{item.title}</td>
            <td>{item.author_name}</td>
            <td>{item.cost}</td>
            <td>{item.book_quantity}</td>
           </tr>
      )
         })
         :
        books.map((item)=>{
          return(
           <tr key={item.id}>
            <td>{item.id}</td>
            <td>{item.title}</td>
            <td>{item.author_name}</td>
            <td>{item.cost}</td>
            <td>{item.book_quantity}</td>
           </tr>
      )
         })
        }

    </tbody>
    </table>
         </div>
      </div>
      )
}
export default Search;
